import React from "react";
import image from "../../assets/product1/product1.png";
import { Container } from "react-bootstrap";
const OrderProduct = () => {
    return (
        <div className="orderproduct">
            <Container>
                <Row>
                    <img src={image} alt="" />
                    <div className="orderproduct-choose">
                        <h2>Shaman Tea</h2>
                    </div>
                </Row>
            </Container>
        </div>
    );
};

export default OrderProduct;
